// src/components/Node.js
import React from 'react';

const Node = ({ id, label, position, onDrag }) => {
  return (
    <div
      className="node"
      style={{ left: position.x, top: position.y }}
      draggable
      onDrag={(e) => onDrag(e, id)}
    >
      <span>{label}</span>
    </div>
  );
};

export default Node;
